import styled from "styled-components";

export const StyledTexture = styled.div`

  display: flex;
  flex-direction: column;
  padding : 5px;
  margin: 5px;
  position: absolute;
  left : 40%;
  align-items : center;
 
  .grid-item > div > div {
    display: flex;
    padding: 5px;
  }
 
  .grid-item {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    
  }
  .grid-item > div {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    padding: 5px;
  }
`;
